setupMatGeom %[output:43665bf8]
%%
paths.project = "/Users/ernesto/Desktop/Tumors"; %[control:filebrowser:80e3]{"position":[17,48]}
ls(paths.project) % display folder contents %[output:1be3dee1]
paths.intensity = fullfile(paths.project,"MRBT1stripped.nrrd");
paths.segment = fullfile(paths.project,"Merged Segmentations.seg.nrrd") %[output:1673004a]
structfun(@(x) exist(x,"file"),paths) % make sure paths exist - a zero means the indicated file does not exist %[output:165935b7]
%%
mVint = medicalVolume(paths.intensity) %[output:48f79cde]
mVseg = medicalVolume(paths.segment) %[output:17a4874e] %[output:0e7be252]
%[text] - 4D Array - there are layers in this bitch \
%%
segT = mmGetSlicerSegTable(paths.segment) %[output:409f5484]
%[text] - Since we have 3 different layers, we can't just plug-in segmentation volume into volshow. 
%[text] - We need to index out each segmentation \
%%
brainSeg = mmGetMedicalVolumeSegment(mVseg,segT,segName="brain") %[output:1f115e8c]
t1Seg = mmGetMedicalVolumeSegment(mVseg,segT,segName="Tumor1") %[output:656e50bb]
t2Seg = mmGetMedicalVolumeSegment(mVseg,segT,segName="Tumor2") %[output:4b9690b7]
%%
hvr3 = viewer3d(BackgroundColor="white",BackgroundGradient="off",CameraZoom=1); % set background color to white and turn off gradient
hvol = volshow(mVint,Parent=hvr3, ... %[output:group:8159362e] %[output:3d76bfe8] %[output:2b7b52a1]
    RenderingStyle="GradientOpacity", ... % makes intensity volume transparent %[output:3d76bfe8] %[output:2b7b52a1]
    OverlayData=t1Seg.mask) % add Segmentations %[output:group:8159362e] %[output:3d76bfe8] %[output:2b7b52a1]
%%
hvol.Alphamap = single(linspace(0,0.75,256)); % voxel alpha values
%%
hvol.OverlayAlpha = single(0.75); % increase alpha of overlay
%%
hvol.RenderingStyle="CinematicRendering";
%%
%[text] ## Display Surfaces
%[text] To display surfaces, we use the function **`mmPlotMask2Surface`** and we input the mask from the Seg Structures (generated by **`mmGetMedicalVolumeSegment`**). To properly display our structures in mm space, we assign the transformation matrix to `tform`, using the function **`intrinsicToWorldMapping`**. We will add this variable to our plot call. Since we have multiple seg structures, we need to call **`mmPlotMask2Surface`** multiple times, but each call to **`mmPlotMask2Surface`** adds lighting to the scene. Too much lighting, will make the scene look washed out. So, on the first call to **`mmPlotMask2Surface,`** we set the option 'lightEMup' to false. This adds no lighting to the scene. On the second call, we set the option to true (this is the default). And we get reasonable lighting on the scene.  
%[text] 
%%
[0.969 0.961 0.816] % choose a suitable color for the brain segmentation %[control:colorPicker:2342]{"position":[1,20]} %[output:1348937b]
%%
tform = intrinsicToWorldMapping(mVseg.VolumeGeometry); % create transformation matrix (scale, rotate, translate) %[output:3b6fc0eb]
figure %[output:1e251203]
mmPlotMask2Surface(brainSeg.mask,"fcolor",'#f7f5d0','affTrfm',tform.A,'smooth',true,'lightEMup',false) %[output:49dcbcad] %[output:1e251203]
mmPlotMask2Surface(t1Seg.mask,"fcolor",'cyan','affTrfm',tform.A,'smooth',false, 'lightEMup',true) %[output:1e251203] %[output:0991ff81]

